import React from 'react';
import { useNavigate } from 'react-router-dom';

const AuthenticatedHomePage = () => {
  const navigate = useNavigate();

  const navigateToLearnerDashboard = () => {
    navigate('/learner-dashboard'); // Update with your correct route
  };

  const navigateToReviewerDashboard = () => {
    navigate('/reviewer-dashboard'); // Update with your correct route
  };

  return (
    <div>
      <h1>Welcome to the Authenticated Home Page</h1>
      <button onClick={navigateToLearnerDashboard}>Learner Dashboard</button>
      <button onClick={navigateToReviewerDashboard}>Reviewer Dashboard</button>
    </div>
  );
};

export default AuthenticatedHomePage;
